import React from "react";
import { gql } from "@apollo/client";
// import { graphql } from "graphql";

const getBooksQuery = gql`
  {
    books {
      name
      id
    }
  }
`;

const BookList = () => {
  return (
    <div>
      <ul id="book-list">
        <li>Book name</li>
      </ul>
    </div>
  );
};

export default gql(getBooksQuery)(BookList);
